function initMap() {
  document.getElementById("exit_button").style.display = "none";
  document.getElementById("navto_button").style.display = "none";
  var map_point = {
    lat: 51.5,
    lng: -0.1
  }
  map = new google.maps.Map(document.getElementById('map'), {
    zoom: current_zoom,
    center: history_point
  });

  map.addListener('click', function(event) {
    addMarker(event.latLng);
  });
}

function OnMouseIn(elem){
	elem.style.backgroundColor = "#C2C2C2";
}

function OnMouseOut(elem){
	elem.style.backgroundColor = "#EEEEEE";
}

function OnMouseIn_Panel(elem){
	elem.style.backgroundColor = "#787878";
}

function OnMouseOut_Panel(elem){
	elem.style.backgroundColor = "#464646";
}

function look_up_point()
{
  var part_one = "";
  var part_two = "";

  var site_id_input = document.getElementById('site_id').value;

//Format anything the user has entered as SFM ID 12/123456
  if (site_id_input.indexOf("/") !== -1)
  {
  	//Easy case, just make sure both parts are long enough
  	part_one = site_id_input.substring(0,site_id_input.indexOf("/"));
	if (part_one.length > 2)
		part_one=part_one.substring(part_one.length-2);
  	if (part_one.length !== 2)
  		part_one = "0" + part_one;
  	part_two = site_id_input.substring(site_id_input.indexOf("/") + 1);
	if (part_two.length > 6)
		part_two=part_two.substring(part_two.length-6);
  	while (part_two.length !== 6)
  		part_two = "0" + part_two;
   }  
  else
  {
	while (site_id_input.length < 5)
		site_id_input = "0" + site_id_input;
	if (site_id_input.length == 5)
		site_id_input=site_id_input.substring(0,2) + "000" + site_id_input.substring(2);
	if (site_id_input.length > 8)
		site_id_input=site_id_input.substring(site_id_input.length-8);
		
	part_one = site_id_input.substring(0,2);
	part_two = site_id_input.substring(2);	
  }

  site_id_input = part_one + "/" + part_two;
  document.getElementById('site_id').value=site_id_input;

//End of formatting

function setMapOnAll(map) {
  for (var i = 0; i < markers_array.length; i++) {
    markers_array[i].setMap(map);
  }
}

function addMarker(location) {
  var marker = new google.maps.Marker({
    position: location,
    map: map,
    animation: google.maps.Animation.DROP
  });

  marker.addListener('click', function() {
    //map.setZoom(15);
    map.setCenter(marker.getPosition());
	
	var geocoder = new google.maps.Geocoder();
	geocoder.geocode( { 'location': location  }, function(results, status) {
		var lookTo = location;
                global_longitude = lookTo;
		
		var pano = new google.maps.StreetViewPanorama(


      		document.getElementById('map'), {
        		position: location,
      		});

		var service = new google.maps.StreetViewService;
		service.getPanoramaByLocation(pano.getPosition(), 50, function(panoData){

		var panoCenter = panoData.location.latLng;	
      	var headingNew = google.maps.geometry.spherical.computeHeading(panoCenter,location);
      	var pov = pano.getPov();
      	pov.heading = headingNew;
      	pano.setPov(pov);
		});
	});

    document.getElementById("exit_button").style.display = "inline";
    document.getElementById("navto_button").style.display = "inline";
    document.getElementById("top_bit").style.display = "none";
    document.getElementById("clearm_button").style.display = "none";
    document.getElementById("dmarks_button").style.display = "none";
    document.getElementById("smarks_button").style.display = "none";
    document.getElementById("top_bit").style.height = "0%";
    document.getElementById("wrapper").style.height = "100%";
    document.getElementById("floating-panel").style.top = "88%";

    history_point = location;
 });

markers_array.push(marker);
}
    
// Removes the markers from the map, but keeps them in the array.
function clearMarkers() {
  setMapOnAll(null);
}

// Shows any markers currently in the array.
function showMarkers() {
  setMapOnAll(map);
}

// Deletes all markers in the array by removing references to them.
function deleteMarkers() {
  clearMarkers();
  markers_array = [];
  document.getElementById('Answer').innerHTML = "";
}
